import React from "react";
import { connect } from "react-redux";
impot
class Planing extends React.Component {
  state = {};
  render() {
    const { locations } = this.props;
    return (
      <div
        className="planing d-flex flex-wrap "
        style={{ width: "200px" }}
      >
        {locations.map((location) => {
          return (
            <div    className='planing__icon-box mb-2' style={{ width: "33.333px" }}>
              <i className={`planing__icon-${location.satus} fa fa-user fa-lg`}></i>
            </div>
          );
        })}
      </div>
    );
  }
}
const maStateToProps = (state) => {
  return {
    locations: state.event.locations,
  };
};

export default connect(maStateToProps,{
    selectSeat
})(Planing);
